        <input onChange={handleChange} type="text" placeholder="Title" />
        <input onChange={handleChange} type="text" placeholder="Artist" />
        <input onChange={handleChange} type="text" placeholder="Genre" />
        <input
          onChange={handleChange}
          type="checkbox"
          name="Album"
          placeholder="Album"
        />
        <button>Add</button>
      </form>
    </div>
  );
}

export default NewMusic;
